import React, { useState } from "react";

function Aaa() {
  const [todos, setTodos] = useState([
    {
      content: "Pickup dry cleaning",
      isCompleted: true,
    },
    {
      content: "Get haircut",
      isCompleted: false,
    },
    {
      content: "Build a todo app in React",
      isCompleted: false,
    },
  ]);
  return (
    <div className="app">
      <form className="todo-list">
        <ul>
          <div className="todo">
            <div className="checkbox" />
            <input type="text" value="Todo one" />
          </div>
        </ul>
      </form>
    </div>
  );
}

export default Aaa;
